INSERT INTO `articles` (`id`, `title`, `picture`, `content`, `date`, `author`) VALUES
(68, 'Elon Musk przerwie finansowanie systemu Starlink na Ukrainie', 'musk.jpeg', 'Starlink to system telekomunikacyjny przez satelity przeznaczony do dostarczania internetu. Kilka dnii po oficjalnym ataku Rosji na Ukrainę zarząd transmisji cyfrowej Ukrainy zaapelował do Elona Muska, aby udostępnił ten system ukraińskiej armii. Po niecałym dniu, firma SpaceX uaktywniła system Starlink Ukrainie. <br>  Do tej pory dostarczono Ukrainie ok. 20 tysięcy urządzeń pozwalających na korzystanie z systemu. Po tym jak Rosjanie odcjęli Ukrainie ich łączność telefoniczną I internetową, to StarLink stał się kluczowy dla komunikacji.  <br>Ostatnio miliarder wspomniał, że jeśli armia USA nie zapewni dodatkowych funduszy w wysokości kilkudziesięciu milionów dolarów miesięcznie, firma SpaceX odetnie StarLink Ukrainie. Elon Musk mówi, że finansowanie tego systemu do końca roku przekroczy 120 mln dolarów, a przez następne 12 miesięcy, kwota wzrośnie, aż do 380mln.', '2022-10-23', 'Gabriel'),
(69, 'Wystawa sztuki oczami Ukraińskich artystów  ', '000FS2KGXHLIUP12-C116-F4.jpg', 'Centrum Sztuki Współczesnej “Zamek Ujazdowski w Warszawie” ogłosiło, że ruszyły prace nad ekspozycją, na której prezentowane będą prace ukraińskich artystów, będące martwą reakcją na rosyjską agresję przedstawiona na papierze.   Otwarcie wystawy pt. “Ukraina. Pod innym niebem” planowane jest na 4 listopada    Według organizatorów, ma to być największa wystawa współczesnej sztyki Ukraińskiej w odpowiedzi na barbarzyński atak Rosji, w którym zaprezentowane będzie ponad 200 prac 32 artystó I artystek. ', '2022-10-23', 'Bartek'),
(71, 'Rosjanie drżą ze strachu. Wywiad brytyjski ma niepodważalne dowody.', 'pobrany plik.jpeg', '242 dzień wojny na Ukrainie. Wywiad brytyjski donosi,  że Rosja szykuje się do defensywy przed ofensywą Ukrainy w okupowanym obwodzie ługańskim.  Wznoszą się tam fortyfikacje obronne zwane \"linią Wagnera\".  Za to Ukarina informuje o sukcesach na polu bitwy.  Zniszczono cztery składy amunicji wojsk rosyjskich oraz także kilkanaście pojazów opancerzonych wroga i wyrzutnię rakiet Grad.  Sztab Ukrainy informuje o manewrach rosyjskich w rejonie Krymu.  Na pokładzie 2 okrętów desantowych i 2 lotniskowców może być nawet 16 pocisków typu Kalibr.', '2022-10-23', 'Gabriel'),
(72, 'Informatyk w Rosji ukrywa się przed mobilizacją do wojska.', 'y2vmi9bxnerhtm4nrfc1vyjjx3aipv9x.jpg', '  Informatyk z południowego regionu Rosji zaprotestował przeciwko inwazji na Ukrainę i został oskarżony o liczne naruszenia administracyjne. <br> Po rozpoczęciu mobilizacji zdecydował, że nie chce iść na front, ale też nie chce wyjeżdżać za granicę. Postanowił więc ukryć się w lesie. Kupił niezbędny sprzęt i żywność i przez miesiąc był na wolności, opisując swoje codzienne życie na swoim kanale Telegram. <br> „Wiedziałem, że pozostanie w mieście nie będzie rozsądnym rozwiązaniem. Dlaczego miałbym uciekać? Nie chcę wyjeżdżać. Chcę, żeby życie wróciło do normy, chcę pomóc tym, którzy zostali, w tym moim bliskim” Kalinin wyjaśnił powód swojej decyzji. Rodzina i koledzy Adama wiedzieli, że teraz mieszka w lesie i podjęli decyzję ze zrozumieniem. Jak mówił, największego wsparcia udzieliła mu żona.  Programista wątpi, że ktoś znajdzie jego kryjówkę: \"Ja znam już to miejsce, ale dla osoby, która nigdy tu nie była, poruszanie się w tym terenie jest znacznie trudniejsze. Jestem świadomy jak trudne jest znalezienie osoby, która zgubiła się w lesie i chce być odnaleziona. Ja się w nim ukrywam\" - tłumaczy.  <br> Jednocześnie przyznaje, że jego pobyt w lesie robi się dłuższy. Więc organizuje drewno na opał, żeby kupić namiot na zimę. \"Spodziewałem się, że spędzę tu około miesiąca i mobilizacja się skończy, albo coś innego się wydarzy. Jednak, biorąc pod uwagę najnowsze wiadomości, możliwe, że zostanę tu na dłużej\" - podkreśla.', '2022-10-22', 'Gabriel'),
(73, 'Pościg i deszcz pieniędzy na drodze w Chile.', 'cod21eh8kss5ks4p5y1bfarg7qodvtu6.jpg', ' Sześciu mężczyzn dokonało nalotu na sklep w stolicy Chile, Santiago. Rabusie zabrali kasie wszystkie pieniądze i uciekli. <br> Według lokalnych mediów, złodzieje ukradli prawie 10 milionów chilijskich pesos, czyli ponad 10 000 dolarów. <br> Policja szybko interweniowała i zaczęła tropić złodziei, którzy uciekli samochodem. <br> Podczas ucieczki rabusie wbiegli na autostradę. Widząc gliniarzy siedzących na ogonach, postanowili odwrócić ich uwagę, rzucając po drodze torby pełne skradzionych pieniędzy. Na całej autostradzie leżą banknoty. <br> Policji powiedziano, że udało im się odzyskać prawie całą skradzioną kwotę i aresztowano wszystkich sześciu przestępców. Jak się okazuje, to obcokrajowcy. Nie poinformowali jednak, z jakiego kraju pochodzą.', '2022-10-15', 'Gabriel'),
(75, 'Włochy: Rząd Giorgii Meloni zaprzysiężony', 'meloni.jpg', 'Lider Bractwa Włoskiego otrzymał od prezydenta Sergio Mattarelliego zlecenie utworzenia nowego rządu. Jej gabinet powstał niecały miesiąc po wyborach parlamentarnych. <br> W 24-osobowym rządzie jest dwóch wicepremierów. Są to Antonio Tajani, szef spraw zagranicznych Forza Italia oraz Matteo Salvini, minister infrastruktury Unii. <br> Ministerstwem Obrony kieruje Guido Crosseto z włoskiej partii Bracis, a sektorem finansowym kieruje Giancarlo Giorgetti z Unii. W centroprawicowym rządzie zasiadają także: Raffaele Fitto, minister spraw europejskich, były gubernator Rzymu Matteo Piantedosi jako minister spraw wewnętrznych oraz dr Tor Vie, rektor Uniwersytetu Rzymskiego Zdrowia Tor Vegata Orazio Schillaci jako minister. <br> Łącznie z premierem Melonim w Radzie Ministrów zasiada sześć kobiet.', '2022-10-22', 'Gabriel');
